import React from 'react';
import { Chart as ChartJS } from 'chart.js/auto';
import { Chart, Pie }            from 'react-chartjs-2';
import "../style/pages/_camembert.scss";
import data from '../data.json';

const Camembert = () => {

    const results= data.map((data) => {

    return (
        <div className="pie">
            <Pie key={data.id}
            
            data={{
                labels: ['Les Grands Tournois !', 'Les Inter-membres !', 'Les Afterworks !', 'Les Tournois Online !'],
                datasets: [
                  {
                      labels: '# of votes',
                      data: [data.votes, data.votes, data.votes, data.votes],
                      backgroundColor: ['#FF6384','#36A2EB','#FFCE56','#8bc34a',],
                      borderWidth: 1,
                  },
              ],
          }}
          options={{
            responsive: true,
            maintainAspectRatio: false,
                scales: {
                  yAxes: [
                      {
                        ticks: {
                            beginAtZero: true,
                        },
                    },
                    ],
              },
          }}
        />
        </div>
    )
    }
    );
};

export default Camembert;
